import React, { Component } from 'react';
import './Section.css';


const TopBar = (props) => {
    return (
        <nav className="nav">
            <h1 className="titles">{props.title}</h1>
            <div style={{width:'10vh'}}><hr /></div>
        </nav>
    );
}


class About extends Component {
    render() {
        return (
            <div className="section">
                <TopBar title={this.props.title}/>

            </div>
        );
    }
}

export default About;
